 package main

import (
	"fmt"
	"strconv"
	"strings"
)

func main() {
	premise := "Jobs Report: U.S. Economy Added 321,000 Jobs In November, Unemployment Steady At 5.8%."
	hypothesis := "U.S. Economy Added 321,000 Jobs in November; Unemployment Rate Is 5.8%."

	premiseWords := strings.Split(premise, " ")
	hypothesisWords := strings.Split(hypothesis, " ")

	var jobs, unemployment int
	var err error

	for _, word := range premiseWords {
		if strings.Contains(word, "Jobs") {
			jobs, err = strconv.Atoi(strings.TrimSpace(word))
			if err!= nil {
				fmt.Println("Error:", err)
				return
			}
		} else if strings.Contains(word, "Unemployment") {
			unemployment, err = strconv.Atoi(strings.TrimSpace(word))
			if err!= nil {
				fmt.Println("Error:", err)
				return
			}
		}
	}

	for _, word := range hypothesisWords {
		if strings.Contains(word, "Jobs") {
			hypothesisJobs, err := strconv.Atoi(strings.TrimSpace(word))
			if err!= nil {
				fmt.Println("Error:", err)
				return
			}
			if hypothesisJobs!= jobs {
				fmt.Println("Contradiction")
				return
			}
		} else if strings.Contains(word, "Unemployment") {
			hypothesisUnemployment, err := strconv.Atoi(strings.TrimSpace(word))
			if err!= nil {
				fmt.Println("Error:", err)
				return
			}
			if hypothesisUnemployment!= unemployment {
				fmt.Println("Contradiction")
				return
			}
		}
	}

	fmt.Println("Entailment")
}

