func main() {
	// define variables for the numerical entities in the premise and hypothesis
	premise_population := 100
	premise_richest_people := 85
	hypothesis_population := 50
	hypothesis_richest_people := 85

	// extract all quantities as valid numbers
	premise_percentage := premise_richest_people / premise_population
	hypothesis_percentage := hypothesis_richest_people / hypothesis_population

	// compare the quantities to infer the relation between the premise and hypothesis
	if premise_percentage > hypothesis_percentage:
		// the hypothesis contradicts the premise
		label := "contradiction"
	else if premise_percentage < hypothesis_percentage:
		// the hypothesis is consistent with the premise, but cannot be explicitly entailed from the premise
		label := "neutral"
	else:
		// the hypothesis is fully and explicitly entailed from the premise
		label := "entailment"

	fmt.Println(label)
}

