 package main

import (
	"fmt"
)

func main() {
	// premise
	premise := "The United Nations last night elected eight judges for the international war crimes tribunal that will try those accused of murders and other atrocities in former Yugoslavia since 1991."
	// hypothesis
	hypothesis := "11 judges in the Yugoslavia war tribunal were sworn in at the World court."

	// extract the numerical entities from the premise
	premise_num_entities := extract_num_entities(premise)
	// extract the numerical entities from the hypothesis
	hypothesis_num_entities := extract_num_entities(hypothesis)

	// compare the numerical entities
	if premise_num_entities[0]!= hypothesis_num_entities[0] {
		// the number of judges in the premise does not match the number of judges in the hypothesis
		fmt.Println("contradiction")
	} else {
		// the number of judges in the premise matches the number of judges in the hypothesis
		fmt.Println("entailment")
	}
}

func extract_num_entities(text string) []int {
	// define a regular expression to match numerical entities
	re := regexp.MustCompile("[0-9]+")
	// find all numerical entities in the text
	matches := re.FindAllString(text, -1)
	// convert the matches to integers
	num_entities := make([]int, len(matches))
	for i, match := range matches {
		num_entities[i], _ = strconv.Atoi(match)
	}
	return num_entities
}

 package main

import "fmt"

func main() {
	// define variables for the numerical entities in the premise
	salePrice := 27.5
	originalPrice := 9.4
	baikalfinansgroupPrice := 9.4
	rosneftPrice := 27.5

	// extract quantities as valid numbers
	fmt.Println("Sale price:", salePrice)
	fmt.Println("Original price:", originalPrice)
	fmt.Println("Baikalfinansgroup price:", baikalfinansgroupPrice)
	fmt.Println("Rosneft price:", rosneftPrice)

	// compare the quantities
	if salePrice > originalPrice {
		// the sale price is greater than the original price, which means that the sale was made to pay the tax bill
		fmt.Println("The sale was made to pay the tax bill.")
	} else {
		// the sale price is less than or equal to the original price, which means that the sale was not made to pay the tax bill
		fmt.Println("The sale was not made to pay the tax bill.")
	}

	if baikalfinansgroupPrice > rosneftPrice {
		// the price of Baikalfinansgroup is greater than the price of Rosneft, which means that the sale was made to a little known company
		fmt.Println("The sale was made to a little known company.")
	} else {
		// the price of Baikalfinansgroup is less than or equal to the price of Rosneft, which means that the sale was made to a well-known company
		fmt.Println("The sale was made to a well-known company.")
	}
}

