import (
	"fmt"
)

func main() {
	// Define variables for the premise and hypothesis
	premise := "Monday, when the hearings begin, the Palestinians will hold their demonstration during the same hours, and a 25-person counter-demonstration by Israelis and Jews will take place."
	hypothesis := "Israelis will demonstrate and a counter-demonstration of 25 Palestinians will be permitted as well."

	// Extract quantities from the premise and hypothesis
	premiseQuantities := []int{25}
	hypothesisQuantities := []int{25}

	// Check if the quantities in the hypothesis contradict the quantities in the premise
	if len(premiseQuantities)!= len(hypothesisQuantities) {
		fmt.Println("contradiction")
	} else {
		for i := 0; i < len(premiseQuantities); i++ {
			if premiseQuantities[i]!= hypothesisQuantities[i] {
				fmt.Println("contradiction")
				break
			}
		}
	}

	// If the quantities do not contradict, check if the hypothesis is fully entailed by the premise
	if len(premiseQuantities) == len(hypothesisQuantities) {
		for i := 0; i < len(premiseQuantities); i++ {
			if premiseQuantities[i] > hypothesisQuantities[i] {
				fmt.Println("entailment")
				break
			}
		}
	}

	// If the quantities do not contradict and the hypothesis is not fully entailed by the premise, the relation is neutral
	if len(premiseQuantities) == len(hypothesisQuantities) {
		for i := 0; i < len(premiseQuantities); i++ {
			if premiseQuantities[i] == hypothesisQuantities[i] {
				fmt.Println("neutral")
				break
			}
		}
	}
}

