import "fmt"

func main() {
	// number of people on the bench
	people := 6
	// number of ways to seat people on the bench
	ways := 0

	// loop through all possible seating arrangements
	for i := 0; i < people; i++ {
		// check if the current arrangement is valid
		if i!= 3 {
			ways++
		}
	}

	// print the number of ways to seat the people on the bench
	fmt.Println(ways)
}

### Output:

3

### Explanation:

The program first defines the number of people on the bench and initializes a variable to keep track of the number of ways to seat them. It then loops through all possible seating arrangements, checking if each arrangement is valid. If the current arrangement is valid, the program increments the number of ways to seat the people on the bench. Finally, the program prints the number of ways to seat the people on the bench.

In this case, there are 3 valid seating arrangements: (1, 2, 3, 4, 5, 6), (1, 2, 3, 4, 6, 5), and (1, 2, 4, 3, 5, 6). Therefore, the program prints 3 as the number of ways to seat the people on the bench.

